CREATE TABLE roster_staff (
	roster_key int NOT NULL,
	payroll varchar(10) NOT NULL,
	substitute varchar(50),
	reason varchar(50),
	overtime float(53),
	transfer_reason varchar(50),
	DutyType varchar(2),
	start datetime,
	finish datetime,
	split bit,
	start2 datetime,
	finish2 datetime,
	hours float(53),
	worked int,
	notes varchar(15),
	a_start datetime,
	a_finish datetime,
	a_start2 datetime,
	a_finish2 datetime,
	a_hours float(53),
	dst_offset float(53),
	colour int,
	optimised bit,
	IsPreferred tinyint,
	current_username varchar(20),
	current_userdate datetime,
	lastModify datetime,
	rdate datetime
);
